// src/components/DashboardMetrics/TeacMetrics.tsx

import React, { useEffect, useState } from 'react';
import { Box, Typography, Grid, Paper, ToggleButton, ToggleButtonGroup, CircularProgress, Snackbar, Alert } from '@mui/material';
import { Line } from 'react-chartjs-2';
import axios from 'axios';
import { Chart as ChartJS, CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend, Filler } from 'chart.js';
import Zoom from 'chartjs-plugin-zoom';
import Annotation from 'chartjs-plugin-annotation';

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend, Filler, Zoom, Annotation);

const TeacMetrics: React.FC = () => {
  const [userStats, setUserStats] = useState<any>(null);
  const [granularity, setGranularity] = useState<'daily' | 'monthly'>('monthly');
  const [loading, setLoading] = useState<boolean>(false);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      try {
        const response = await axios.get(`http://localhost:5000/api/users/metrics/${granularity}`);
        setUserStats(response.data);
        setError(null);
      } catch (error) {
        console.error('Error al obtener datos', error);
        setError('Error al cargar los datos');
        setUserStats(null);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [granularity]);

  const handleGranularityChange = (_event: React.MouseEvent<HTMLElement>, newGranularity: 'daily' | 'monthly') => {
    if (newGranularity !== null) {
      setGranularity(newGranularity);
    }
  };

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Snackbar open={true} autoHideDuration={6000}>
        <Alert severity="error">{error}</Alert>
      </Snackbar>
    );
  }

  const labels = granularity === 'daily' ? userStats?.dates || [] : userStats?.months || [];
  const values = userStats?.values || [];

  const lineChartData = {
    labels: labels,
    datasets: [
      {
        label: 'Número de Usuarios Nuevos',
        data: values,
        borderColor: '#4CAF50',
        backgroundColor: 'rgba(76, 175, 80, 0.2)',
        fill: true
      }
    ]
  };

  return (
    <Box sx={{ flexGrow: 1, p: 3 }}>
      <Typography variant="h4" gutterBottom align="center">
        Métricas del Dashboard
      </Typography>
      <ToggleButtonGroup
        value={granularity}
        exclusive
        onChange={handleGranularityChange}
        aria-label="granularity"
        fullWidth
        sx={{ mb: 3 }}
      >
        <ToggleButton value="daily" aria-label="daily">Diario</ToggleButton>
        <ToggleButton value="monthly" aria-label="monthly">Mensual</ToggleButton>
      </ToggleButtonGroup>
      <Grid container spacing={3} justifyContent="center" alignItems="center">
        <Grid item xs={12} md={10} lg={8}>
          <Paper elevation={3} sx={{ p: 3 }}>
            <Typography variant="h6" gutterBottom align="center">
              Usuarios Nuevos
            </Typography>
            <Box sx={{ position: 'relative', height: '400px' }}>
              <Line 
                data={lineChartData} 
                options={{
                  responsive: true,
                  maintainAspectRatio: false,
                  plugins: {
                    zoom: {
                      pan: {
                        enabled: true,
                        mode: 'xy'
                      },
                      zoom: {
                        enabled: true,
                        mode: 'xy'
                      }
                    },
                    annotation: {
                      annotations: []
                    }
                  },
                  scales: {
                    x: {
                      beginAtZero: true,
                    },
                    y: {
                      beginAtZero: true,
                    }
                  }
                }}
              />
            </Box>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default TeacMetrics;
